import './App.css';
import { Routes, Route } from 'react-router-dom'

function App() {

  <div>
    <Routes>
      <Route path="/" element={<Home/>} />
      <Route path="/fecha" element={<Fecha />} />
    </Routes>
  </div>
}
export default App;
